import React from 'react';
import './LoginForm.css';

class LoginForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      users: [
        { name: "Bùi Văn Tèo", age: 25 },
        { name: "Trần Văn An", age: 29 },
        { name: "Nguyễn Thị Bưởi", age: 22 }
      ],
      job: "IT Communicator"
    };
  };
  changeName = () => {
    this.setState({
      users: [
        { name: "Bùi Văn Tý", age: 27 },
        { name: "Trần Văn An", age: 29 },
        { name: "Nguyễn Thị Bưởi", age: 22 }
      ],
      job: "Bridge System Engineer"
    })
  }
    render() {
        return (
            <main>
            <div className="container">
              <div className="login-form">
                <form>
                  <h1>Đăng Nhập Người Dùng</h1>
                  <div className="input-box">
                    <label for="">Email</label>
                    <p>
                    <input name="email" type="email" placeholder="Nhập Email" />
                    </p>
                  </div>
                  <div className="input-box">
                    <label for="">Password</label>
                    <input name="password" type="password" placeholder="Nhập mật khẩu" />
                  </div>
                  <div className="btn-box">
                    <button onClick={this.changeName} type="button">
                      Đăng nhập
                   </button>
                  </div>
                </form>
              </div>
            </div>
          </main>
        )
    }
}

export default LoginForm;
